import React from 'react';
import './App.css';


class Basic extends React.Component {
    constructor(props) {
        super(props);
        this.submit = this.submit.bind(this);
    }
    submit() {

    }
    render() {
        return (
            <div className="basicInput">
                <div className="inputField">
                    <div className="itemName">调查员姓名：</div>
                    <div className="input"><input /></div>
                </div>
                <div className="inputField">
                    <div className="itemName">职业：</div>
                    <div className="input"><input /></div>
                </div>
                <div className="inputField">
                    <div className="itemName">性格特征：</div>
                    <div className="input"><input /></div>
                </div>
                <div className="inputField">
                    <div className="itemName">背景故事：</div>
                    <div className="input"><textarea /></div>
                </div>
                <button className="basicButton" >下一步</button>
            </div>
        );
    }
}

class Result extends React.Component {
    constructor(props){
        super(props);
    }
    render() {
        return (<div></div>);
    }
}


class App extends React.Component {
    constructor(props) {
        super(props);
        this.data = {
            pageNum: 4,
        }
        this.state = {
            ser: 0,
        }
        this.changeSer = this.changeSer.bind(this);
    }
    changeSer() {
        if (this.state.ser > this.data.pageNum) return;
        this.setState({ ser: this.state.ser++ });
    }
    render() {
        var temp = [<Basic/>,<Result fuck='1'/> ];
        return (
            <div className="App">
                {temp[this.state.ser+1]}
                <button onClick={this.changeSer} />
            </div>
        );
    }
}



export default App;
